import React from 'react';
import { Riuter,Routes, Route } from 'react-router-dom';
import Main from '../pages/main/Main'
import Reshome from '../pages/restaurant/Reshome';
import Signup from '../pages/main/Usersignup';
import Userhome from '../pages/user/Userhome'
import Login from '../pages/main/Userlogin'
import AdminHome from '../pages/admin/Adminhome'
import Deliverypartnerhome from '../pages/delivery/Deliveryhome'


function routes() {
  return (
    <Router>

      <Routes path="/" element={<Main/>}>
        <Route path='userhome' element={<Userhome/>}/>
        <Route path='signup' element={<Signup/>}/>
        <Route path='login' element={<Login/>}/>

      </Routes>
    </Router>
  );
}

export default routes;
